import React from "react";
import { Container, Jumbotron, Image} from "react-bootstrap";

const PortfolioHero = (props) => (
  <Jumbotron bg="dark" variant="dark">
    <Container>
        <Row></Row>
      <h1>
        {props.Headline}
      </h1>
      <h5>
        {props.Subheader}
      </h5>
      <Image src={props.ImageLink} alt={props.ImageAlt} fluid />
      <h2>Overview</h2>
      <h5>{props.Overview}</h5>
    </Container>
  </Jumbotron>
);

export default PortfolioHero;
